import React from 'react';
import { Resizable, ResizableBox } from 'react-resizable';

export default function NoteList(props: any) {
  return (
    <ResizableBox
      width={200}
      height={200}
      minConstraints={[100, 100]}
      maxConstraints={[300, 300]}
    >
      <span>Contents</span>
    </ResizableBox>
  );
}
